import React, { useState, useEffect } from 'react'


const Hourly = ({ hour }) => {
  const [time, setTime] = useState(new Date(hour.time * 1000));

  useEffect(() => {
    getHour();
  })

  const getHour = () => {
    let hour = time.getHours();

    setTime(hour);
  }
  return (
    <div>
      <h6>{}</h6>
    </div>
  )
}

export default Hourly
